The specific error we got said "language item required, but not found". Rust lets you implement bits of itself through these language items. libcore defines most of them, but the last two, panic_fmt and eh_personality , need to be defined by us. Both of these language items involve a feature of Rust called 'panics.' Here's a Rust program that panics: fn main() { panic!("oh no!");
} When the panic! macro executes, it will stop the current thread from executing, and unwind the stack. This is something we really don't want in a kernel. Rust lets us turn this off, though, in our Cargo.toml : [profile.release]
panic = "abort" By adding this to our Cargo.toml , Rust will abort when it hits a panic, rather than unwind. That's good! However, we still need to define those language items. Modify src/lib.rs to look like this: #![feature(lang_items)]
#![no_std] #[lang = "eh_personality"]
extern fn eh_personality() {
} #[lang = "panic_fmt"]
extern fn rust_begin_panic() -> ! { loop {}
} Defining language items is a nightly-only feature, so we add the ![feature] flag to turn it on. Then, we define two functions, and annotate them with the #[lang] attribute to inform Rust that these functions are our language items. eh_personality() doesn't need to do anything, but rust_begin_panic() should never return, so we put in an inifinite loop . Let's try compiling again: $ xargo build --release --target=x86_64-unknown-intermezzos-gnu Compiling intermezzos v0.1.0 (file:///path/to/your/kernel)
$ Success! We've built some Rust code, cross-compiled to our kernel, and we're ready to go. But now, we've got all of our Rust-related stuff in src . But the rest of our files are still strewn around in our top-level directory. Let's do a little bit of cleaning up.

